import './App.css';
const ans1 = "Gengster Burger";

function Questions({value}){
  return (<>
    <label>{value}</label>
    <br></br>
    <input type="text" id="q1" ></input></>
  );
}

function Q1() {
  let q1 = document.getElementById("q1")
  if (q1.value == ans1) {
    q1.addEventListener("keydown", e => {
    if (e.key == "Enter") {
      alert("Hello World!");
    } else {
      alert("Please");
    }
  })
  }
}

function Board() {
  return <Questions className="q1" value="What is my nickname masa sekolah rendah?"/>;
}

function App() {
  return <Board ></Board>
}
export default App;
